/** @format */

import React from 'react';

import './table.row.scss';

const TableRow = ({ item, indx }) => {
	return (
		<div key={indx} className='data-row'>
			<form>
				<div className='cell'>
					<span>{item.id}</span>
				</div>
				<div className='cell'>
					<span>value={item.name}</span>
				</div>
				<div className='cell'>
					<span>{item.price}</span>
				</div>
				<div className='cell'>
					<input type='text' placeholder='Quantity' value={item.quantity} />
				</div>
				<div className='cell'>
					<span>{item.quantity * item.price}</span>
				</div>
				<div className='cell'>
					<span>Edit | Dele</span>
				</div>
			</form>
		</div>
	);
};
export default TableRow;
